CREATE TABLE `sl_dtr` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `applicant_id` int(10) unsigned zerofill NOT NULL,
  `time_in` datetime NOT NULL,
  `time_out` datetime DEFAULT NULL,
  `diff` time GENERATED ALWAYS AS (timediff(`time_out`,`time_in`)) VIRTUAL,
  `task` varchar(250) DEFAULT NULL,
  `sem_year` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_sl_dtr_sl_applicant1_idx` (`applicant_id`)
) ENGINE=InnoDB AUTO_INCREMENT=40 DEFAULT CHARSET=utf8mb4;

