CREATE TABLE `sl_dtr_report` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `applicant_id` int(11) unsigned zerofill NOT NULL,
  `month` varchar(10) DEFAULT NULL,
  `year` varchar(4) DEFAULT NULL,
  `semester_year` varchar(30) DEFAULT NULL,
  `total_hours` int(11) DEFAULT NULL,
  `salary` float DEFAULT NULL,
  `salary_status` date DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_index` (`applicant_id`,`month`,`year`),
  CONSTRAINT `fk_applicant_id` FOREIGN KEY (`applicant_id`) REFERENCES `sl_applicant` (`applicant_id`)
