CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `studentdetails` AS select `s`.`Student_id` AS `student_id`,`s`.`reg_id` AS `reg_id`,`c`.`course_id` AS `course_id`,`c`.`title` AS `coursetitle`,`c`.`name` AS `coursename`,`c`.`major` AS `major`,`SF_GET_DATA_FROM_COLLEGE_BY_ID`('title',`SF_GET_DATA_FROM_COURSE_BY_ID`('college_id',`c`.`course_id`)) AS `college`,`s`.`last_name` AS `last_name`,`s`.`first_name` AS `first_name`,`s`.`middle_name` AS `middle_name`,`s`.`suffix` AS `suffix`,`FULLNAME`(`s`.`first_name`,`s`.`middle_name`,`s`.`last_name`,'',`s`.`suffix`,'','with_extensions') AS `fullname`,`s`.`house_block_lot_num` AS `house_block_lot_num`,`s`.`street` AS `street`,`s`.`prk_vill_sub` AS `prk_vill_sub`,`s`.`brgy` AS `brgy`,`s`.`city` AS `city`,`s`.`province` AS `province`,`SF_GET_FULL_ADDRESS`(`s`.`house_block_lot_num`,`s`.`street`,`s`.`prk_vill_sub`,`s`.`brgy`,`s`.`city`,`s`.`province`) AS `full_address`,`s`.`zip_code` AS `zip_code`,`s`.`nationality` AS `nationality`,`s`.`civil_status` AS `civil_status`,`s`.`religion` AS `religion`,`s`.`sex` AS `sex`,`s`.`phone_number` AS `phone_number`,`s`.`birth_date` AS `birth_date`,`SF_GET_AGE`(`s`.`birth_date`) AS `age`,`s`.`birth_place` AS `birth_place`,`s`.`email_add` AS `email_add`,`s`.`section` AS `section`,`s`.`year_level` AS `year_level`,`s`.`type` AS `type`,`s`.`student_status` AS `student_status`,`s`.`account_status` AS `account_status`,`s`.`cor` AS `cor`,`s`.`e_signature` AS `e_signature`,`s`.`pic` AS `pic`,`s`.`password` AS `password`,`s`.`date_submitted` AS `date_submitted`,`s`.`date_verified` AS `date_verified`,`sf_check_verified`(`s`.`date_verified`) AS `verified_status`,`e`.`living_with` AS `living_with`,`e`.`others_specify` AS `others_specify`,`e`.`guardian_name` AS `guardian_name`,`e`.`guardian_occupation` AS `guardian_occupation`,`e`.`guardian_contact` AS `guardian_contact`,`e`.`city_address` AS `city_address`,`e`.`parent_name` AS `parent_name`,`e`.`parent_occupation` AS `parent_occupation`,`e`.`parents_address` AS `parents_address`,`e`.`parents_contact` AS `parents_contact`,`e`.`spouse_name` AS `spouse_name`,`e`.`spouse_occupation` AS `spouse_occupation`,`e`.`spouse_contact` AS `spouse_contact`,`e`.`prev_gwa` AS `prev_gwa`,`e`.`prev_total_units` AS `prev_total_units`,`SF_GET_ORG_WHERE_STUDENT_IS_GOVERNOR_PRESIDENT`(`s`.`Student_id`) AS `org_id`,`SF_GET_DATA_FROM_SCHOOL_ORG_BY_ID`('org_name',`SF_GET_ORG_WHERE_STUDENT_IS_GOVERNOR_PRESIDENT`(`s`.`Student_id`)) AS `school_org`,`SF_GET_STUDENT_POSITION_IN_ORG`(`SF_GET_ORG_WHERE_STUDENT_IS_GOVERNOR_PRESIDENT`(`s`.`Student_id`),`s`.`Student_id`) AS `position`,`s`.`patinfo_status` AS `patinfo_status` from ((`student` `s` left join `emergency_contact` `e` on(`e`.`Student_id` = `s`.`Student_id`)) left join `course` `c` on(`c`.`course_id` = `s`.`course_id`));

